import Default_page from "./components/Default_page";
import View from "./compenents/View";
import Editor from "./components/Editor";
import {BrowserRouter,Routes,Route} from "react-router-dom";

const root = ReactDOM.createRoot(document.getElementById("root"));
// const [value, setValue] = useState([{id:1,name:'Todo1',complete:false}]);
root.render(
  <React.StrictMode >
  <BrowserRouter>
    <Routes>
      <Route element={<App />} >
        <Route exact path="/" element={<Default_page />} ></Route>
        <Route path="/:id" element={<View />}></Route>
        <Route path="/:id/edit" element={<Editor />}></Route>
      </Route>
    </Routes>
  </BrowserRouter>
  </React.StrictMode>
);
